import React, { useState } from 'react';
import axios from 'axios';
 
function CreateReservation() {
  const [reservationData, setReservationData] = useState({
    reservationDate: '',
    reservationTime: '',
    status: 'Pending',
  });
  const [message, setMessage] = useState('');
 
  const handleSubmit = (event) => {
    event.preventDefault();
 
    axios.post('/reservations/createReservation', reservationData)
      .then(response => {
        setMessage('Reservation created successfully!');
        setReservationData({
          reservationDate: '',
          reservationTime: '',
          status: 'Pending',
        });
      })
      .catch(error => {
        setMessage('Error creating reservation');
        console.error(error);
      });
  };
 
  return (
<div>
<div className="create-reservation-container">
<h2>Create Reservation</h2>
<form onSubmit={handleSubmit}>
<label>Reservation Date:</label>
<input
            type="date"
            value={reservationData.reservationDate}
            onChange={(e) => setReservationData({ ...reservationData, reservationDate: e.target.value })}
            required
          />
 
          <label>Reservation Time:</label>
<input
            type="time"
            value={reservationData.reservationTime}
            onChange={(e) => setReservationData({ ...reservationData, reservationTime: e.target.value })}
            required
          />
 
          <button type="submit" className="submit-button">Create Reservation</button>
</form>
        {message && <p className="message">{message}</p>}
</div>
 
      <footer className="footer">
<div className="footer-section">
<h3>TeknoLib</h3>
<p>Contact us</p>
<p>TeknoLib@gmail.com</p>
<p>+1-2345-6789</p>
<p>Cebu Institute of Technology University</p>
<div className="social-icons">
<i className="fab fa-facebook"></i>
<i className="fab fa-twitter"></i>
<i className="fab fa-instagram"></i>
<i className="fab fa-envelope"></i>
</div>
</div>
 
        <div className="footer-section">
<h3>Products</h3>
<p>Auctor volutpat</p>
<p>Fermentum turpis</p>
<p>Mi consequat</p>
<p>Convallis porttitor</p>
</div>
 
        <div className="footer-section">
<h3>About</h3>
<p>Cajegas, Angelo</p>
<p>Tesaluna, Josh</p>
<p>Basalo, Michael</p>
<p>Paquero, Ronan</p>
<p>Cagampang, Emmanuel</p>
</div>
<div className="footer-bottom">
<p>© 2020. All rights reserved.</p>
</div>
</footer>
 
      <style>{`
        .create-reservation-container {
          background-color: rgba(255, 255, 255, 0.9);
          padding: 30px;
          border-radius: 10px;
          width: 40%;
          margin: auto;
          text-align: center;
        }
 
        h2 {
          color: #333;
          margin-bottom: 20px;
        }
 
        form {
          display: flex;
          flex-direction: column;
        }
 
        label {
          margin-top: 10px;
          color: #333;
        }
 
        input[type="date"],
        input[type="time"],
        button.submit-button {
          padding: 10px;
          margin-top: 5px;
          border-radius: 5px;
          border: 1px solid #ddd;
        }
 
        button.submit-button {
          background-color: #ffb703;
          color: #fff;
          cursor: pointer;
          margin-top: 15px;
        }
 
        .message {
          color: green;
          margin-top: 10px;
        }
 
        .footer {
          display: flex;
          justify-content: space-around;
          background-color: #f8f9fa;
          padding: 40px 20px;
          color: #333;
        }
 
        .footer-section {
          display: flex;
          flex-direction: column;
          gap: 5px;
        }
 
        .footer-section h3 {
          font-size: 1.2em;
          margin-bottom: 10px;
          color: #333;
        }
 
        .social-icons {
          display: flex;
          gap: 10px;
          margin-top: 10px;
        }
 
        .social-icons i {
          color: #333;
          font-size: 1.2em;
        }
 
        .footer-bottom {
          text-align: center;
          margin-top: 20px;
          color: #666;
          font-size: 0.9em;
        }
 
        .footer-bottom p {
          margin: 0;
        }
      `}</style>
</div>
  );
}
 
export default CreateReservation;
